// import the component class from react
import React, {Component} from 'react';
import ReactDOM from 'react-dom';

// extend this class to a component class
class List extends Component {
    // render method returns re-act elements describing what should appear on the screen.
    render() {
        // We will populate the list items with the data that was passed in as a prop from the component instance.
        return ( <ol>                    
                    {this.props.tasks.map((task, index) => <li key = {index}> {task} </li>)}
                </ol>)
    }
}

class Title extends Component {
    render() {
        return (
            <h1> Task List </h1>
        )
    }
}

class Main extends Component {
    render () {
        return <div>
            <Title/>
            <List tasks = {['pick up John', 'do homework']}/>
            <List tasks = {['finish udemy lesson', 'study machine learning']}/>
        </div>
    }
}

ReactDOM.render(<Main/>, document.getElementById('root'));
